import React from 'react';
import './ProjectContentPage.css';
import { Link } from 'react-router-dom';
import { collaboratorData } from './CollaboratorData';
import Navbar from './Navbar';

function ProjectContentPage({ project, projectList }) {
  if (!project) {
    return <div>Project not found.</div>;
  }

  const collaborators = project.Collaborators.split(',').map(name => name.trim());

  return (
    <div>
      <Navbar />
      <div className="content-page">
        <img src={`${process.env.PUBLIC_URL}/images/${project.projectPictureSrc}`} alt={project.title} className="contentmain-img" />
        <div className="content-text">
          <h2>{project.title}</h2>
          <p className="description">{project.longContent}</p>
          <h3>In Collaboration with</h3>
          <div className="collabcard">
            {collaborators.map((collaborator) => {
              const collab = collaboratorData.find(member => member.name === collaborator);
              const imageSrc = collab ? collab.image : `${process.env.PUBLIC_URL}/images/defaultpic.png`;
              console.log("check collab",project);
              return (
                <div className="collabcard-content" key={collaborator}>
                  <img src={imageSrc} alt={collaborator} />
                  {/* {proj.reportName && (
                    <a
                      href={`${process.env.PUBLIC_URL}/pdf/${proj.reportName}`}
                      target="_blank"
                      rel="noopener noreferrer"
                      className="project-button"
                    >
                      View Report
                    </a>
                  )} */}
                </div>
              );
            })}
          </div>
        </div>
        <div className="border-line"></div>
        <div className="other-projects">
          <h2>Other Projects</h2>
          <div className="project-cards">
            {projectList.filter(p => p.title !== project.title).map((proj, index) => (
              <div className="project-card" key={index}>
                <img src={`${process.env.PUBLIC_URL}/images/${proj.pictureSrc}`} alt={proj.title} />
                <h3>{proj.title}</h3>
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
}

export default ProjectContentPage;
